from sympy import mobius, integer_nthroot, primefactors
def A370833(n):
    def f(x): return n+x-sum(mobius(k)*(x//k**3) for k in range(1, integer_nthroot(x,3)[0]+1))
    m, k = n, f(n)
    while m != k:
        m, k = k, f(k)
    return max(primefactors(m),default=1) # _Chai Wah Wu_, Aug 06 2024

